// GuestStatus.js
import React, { useEffect, useState } from "react";

export default function GuestStatus() {
  const [status, setStatus] = useState("");
  const email = localStorage.getItem("guestEmail");

  useEffect(() => {
    if (email) {
      fetch(`http://localhost:8080/guest/status/${encodeURIComponent(email)}`)
        .then((res) => {
          if (!res.ok) throw new Error("Backend error: " + res.status);
          return res.text();
        })
        .then((data) => setStatus(data))
        .catch((err) => setStatus("Error fetching status: " + err.message));
    }
  }, [email]);



  if (!email) {
    return <p>No guest email found. Please login again.</p>;
  }

  return (
    <div className="container mt-5">
      <h2>Application Status</h2>
      <p><strong>Email:</strong> {email}</p>
      <p><strong>Status:</strong> {status}</p>
    </div>
  );
}
